import React from 'react';
import Pation from './Pation';
import Apointment from './Appointment';
import Drug from './Drug';
import './App.css';

function Navbar() {
  return (
<div>
<ul>
  <li><a class="active" href="#home">Home</a></li>
  <li><a href="#news">pation</a></li>
  <li><a href="#contact">appointement</a></li>
  <li><a href="#about">drug</a></li>
</ul>
</div>

  );
}

export default Navbar;
